import React, {useEffect, useState} from "react";
import Container from "react-bootstrap/Container";
import {Col, Row} from "react-bootstrap";

const Main = (props) => {
    const[message, setMessage] = useState([]);
    useEffect(()=>{
        fetch("/hello")
            .then((res)=>{
                return res.json();
            })
            .then((data)=> {
                setMessage(data);
            })
    }, []);

    return (
        <Container>
            <div id = "a">
                <Row>
                    <Col sm={8}><p>ㅎㅇ</p></Col>
                    <Col sm={4}>sm=4</Col>
                </Row>
            </div>
        </Container>
    )
}
export default Main;
